int minGroupsForValidAssignment(int* nums, int numsSize) {
    int freq[100001] = {0}, maxFreq = 0;
    for (int i = 0; i < numsSize; ++i) {
        freq[nums[i]]++;
        if (freq[nums[i]] > maxFreq) {
            maxFreq = freq[nums[i]];
        }
    }
    int groupCounts[100001] = {0};
    for (int i = 0; i < 100001; ++i) {
        if (freq[i] > 0) {
            groupCounts[freq[i]]++;
        }
    }
    int groupsNeeded = 0, remaining = 0;
    for (int i = maxFreq; i > 0; --i) {
        groupsNeeded += (groupCounts[i] + remaining) / (i + 1);
        remaining = (groupCounts[i] + remaining) % (i + 1);
        if (remaining > 0) {
            groupsNeeded++;
            remaining = i + 1 - remaining;
        }
    }
    return groupsNeeded;
}
